import React from 'react';
import './Features.css';
import { FaDumbbell, FaLaptop, FaUsers, FaHeartbeat } from 'react-icons/fa';

const Features = () => {
  const features = [
    {
      icon: <FaDumbbell />,
      title: "Personal Training",
      description: "One-on-one customized training sessions designed to maximize your results.",
      pricing: "Starting at $130/hour"
    },
    {
      icon: <FaLaptop />,
      title: "Online Coaching",
      description: "Expert guidance from anywhere with custom workout plans and nutrition advice.",
      pricing: "Starting at $80/month"
    },
    {
      icon: <FaUsers />,
      title: "Group Sessions",
      description: "High-energy group workouts that combine motivation with results.",
      pricing: "Starting at $100/session"
    },
    {
      icon: <FaHeartbeat />,
      title: "Nutrition Planning",
      description: "Comprehensive nutrition strategies to complement your fitness journey.",
      pricing: "Starting at $60 for 3-month package"
    }
  ];

  return (
    <section id="services" className="features">
      <div className="container">
        <h2 className="section-title">OUR SERVICES</h2>
        <h3 className="promo-text">Try our free 20 min session in order to experience the best hands on training in Miami</h3>
        <div className="features-grid">
          {features.map((feature, index) => (
            <div className="feature-card" key={index}>
              <div className="feature-icon">{feature.icon}</div>
              <h3>{feature.title}</h3>
              <p>{feature.description}</p>
              <p className="pricing">{feature.pricing}</p>
            </div>
          ))}
        </div>
        <div className="pricing-note">
          <p>Payment plans are available. Contact us for details.</p>
        </div>
      </div>
    </section>
  );
};

export default Features;
